Wonder Woman v2 #77-80
Publisher:  DC Comics
Publication Date:  August - November 1993

Writer:  William Messner-Loebs
Penciller:  Lee Moder (#77-78), Steve Carr (#79-80), and Deryl Skelton (#79-80)
Inker:  Ande Parks (#77-79) and Aaron McClellan (#78-80)
Colorist:  Brian SetZer (#77) and Patricia Mulvihill (#78-80)
Letterer:  John Costanza (#77-78, 80) and Clem Robins (#79)
Cover Artist:  Brian Bolland

Wonder Woman #77
Just as Diana starts putting together the pieces of the high-tech crime she's been investigating, her search is cut short by the menace of a mystery villain with great wealth who's set his sights on Wonder Woman.

Wonder Woman #78
Mayfly, the international super-assassin in the employ of Ares Buchanan, stalks Diana and Etta Candy. Meanwhile, Diana must help Etta curb her dieting frenzy before she falls victim to anorexia, but Mayfly may make that problem inconsequential as she moves in for the kill!

Wonder Woman #79
Mayfly, the super-fast assassin, was quick enough to take out the Flash...and now she's stalking Wonder Woman and Etta Candy!

Wonder Woman #80
After her encounter with the super-fast assassin Mayfly, Wonder Woman hovers at the brink of death! And in the Amazon's absence, Mayfly's mysterious employer escalates his schemes against Wonder Woman and the city of Boston.

Thanks goes to Ok C.O.M.P.U.T.O. for this release.

